import "./App.css";
import Todo from '../Todo/Todo';

function App() {
  return (
    <div className="App">
      <h1>My Todos!</h1>
      <Todo title='Lea'/> {/* custom html element */}
      <Todo />
      <Todo/>
      <Todo />
    </div>
  );
}

export default App;
